function addGlobalStyle(css) {
    var head, style;
    head = document.getElementsByTagName('head')[0];
    if (!head) { return; }
    style = document.createElement('style');
    style.type = 'text/css';
    style.innerHTML = css;
    head.appendChild(style);
}
function addGlobalScript(css) {
    var head, style;
    head = document.getElementsByTagName('head')[0];
    if (!head) { return; }
    style = document.createElement('script');
    style.innerHTML = css;
    head.appendChild(style);
}
var docURL = location.href;

addGlobalStyle('.bgRepeat {padding-top:120px;}'+
'#ctl00_dashboardNav { position:fixed;  z-index:500; margin-top:-120px;}'+
'.sContent {}');
(function() {
var css = "@namespace url(http://www.w3.org/1999/xhtml); /* Works on Bungie.net ==================== */ /* Created By: PKF 647 ==================== */ /* Created On: May 4, 2009 ================ */ body.popup { background: #000; margin:0 !important; font: 12px/15px Arial, Helvetica, sans-serif !important; color: #bbb; width: 680px !important; overflow-x:hidden !important; } /* Nav Bar */ div.sContent { width: 902px !important; margin: 0 auto !important; padding:0; border-bottom:solid 5px #000 !important; float: none !important;} div.sContent-head { width: 1100px !important; float: none !important; background: transparent url(data:image/gif;base64,) repeat-x !important; height: 121px !important; background-attachment: scroll !important; margin: 0 auto !important;} div.sContentpopup {width: 1100px !important; float: none !important; background: transparent url(data:image/gif;base64,) repeat-x !important; background-attachment: scroll !important; margin: 0 auto !important;} .top_logo_bungie { background-image: Url(data:image/png;base64,) !important; } div.bgRepeat { width: 100% !important; background-image: url() !important ;} ";
if (typeof GM_addStyle != "undefined") {
	GM_addStyle(css);
} else if (typeof addStyle != "undefined") {
	addStyle(css);
} else {
	var heads = document.getElementsByTagName("head");
	if (heads.length > 0) {
		var node = document.createElement("style");
		node.type = "text/css";
		node.appendChild(document.createTextNode(css));
		heads[0].appendChild(node); 
	}
}
})();
